import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    // Perform login logic here (API call)
    const response = await fetch('http://localhost:5000/api/login', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ email, password }),
    });

    if (response.ok) {
      const data = await response.json();
      // Store user details and token in localStorage
      localStorage.setItem('token', data.token);
      localStorage.setItem('user', JSON.stringify(data.user));

      // On successful login, navigate to the favorites page
      navigate('/favourites');
    } else {
      alert('Login failed');
    }
  };


  return (
    <div>
      <section class="normal-breadcrumb">
        <div class="container-fluid">
          <div class="row">
            <div class="col-lg-12 text-center position-relative">
              <img src="assets/img/normal-breadcrumb.jpg" alt="Breadcrumb Background" class="img-fluid" />
              <div class="normal__breadcrumb__text">
                <h2>Login</h2>
                <p>Welcome to the official Anime blog.</p>
              </div>
            </div>
          </div>
        </div>
      </section>

      <section class="login spad">
        <div class="container">
          <div class="row">
            <div class="col-lg-6">
              <div class="login__form">
                <h3>Login</h3>
                <form onSubmit={handleSubmit}>
                  <div class="input__item">
                    <input type="email"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)} placeholder="Email address" />
                    <span class="icon_mail"></span>
                  </div>
                  <div class="input__item">
                    <input type="password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)} placeholder="Password" />
                    <span class="icon_lock"></span>
                  </div>
                  <button type="submit" class="site-btn">Login Now</button>
                </form>
                <a href="#" class="forget_pass">Forgot Your Password?</a>
              </div>
            </div>
            <div class="col-lg-6 d-flex justify-content-center align-items-center">
              <div class="login__register text-center">
                <h3>Don't Have An Account?</h3>
                <a href="/register" class="primary-btn">Register Now</a>
              </div>
            </div>

          </div>
          <div class="login__social">
            <div class="row d-flex justify-content-center">
              <div class="col-lg-6">
                <div class="login__social__links">
                  <span>or</span>
                  <ul>
                    <li><a href="#" class="facebook"><i class="fa fa-facebook"></i> Sign in With
                      Facebook</a></li>
                    <li><a href="#" class="google"><i class="fa fa-google"></i> Sign in With Google</a></li>
                    <li><a href="#" class="twitter"><i class="fa fa-twitter"></i> Sign in With Twitter</a>
                    </li>
                  </ul>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Login;
